// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract Relayer {
    using SafeERC20 for IERC20;

    mapping (address => uint256) private _balances;
    mapping(address => bool) public supportedTokens;
    mapping(uint => bytes32) private _roots;

    uint private rootCount = 0;
    address payable private owner;

    event Deposit(address indexed sender, uint256 amount);
    event Received(address indexed sender, uint256 value);
    event Withdraw(address indexed receiver, uint256 amount);
    event Transfer(address indexed from, address indexed to, uint256 amount);
    event RootAdded(uint id, bytes32 root);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can call this function");
        _;
    }

    constructor() {
        owner = payable(msg.sender);
    }

    // A function to add a new ERC20 token to the supported list
    function addToken(address token) external onlyOwner { 
        require(token != address(0), "Invalid token address");
        require(!supportedTokens[token], "Token already supported");
        supportedTokens[token] = true;
    }

    // A function to remove an ERC20 token from the supported list
    function removeToken(address token) external onlyOwner {
        require(token != address(0), "Invalid token address");
        require(supportedTokens[token], "Token not supported");
        supportedTokens[token] = false;
    }

    // A function to transfer ERC20 tokens from the contract to another address 
    function transferToken(address token, address to, uint256 value) external onlyOwner returns (bool) { 
        require(token != address(0), "Invalid token address"); 
        require(to != address(0), "Invalid recipient address"); 
        require(value > 0, "Invalid value"); 
        require(supportedTokens[token], "Token not supported"); 
        IERC20(token).safeTransfer(to, value); 
        emit Transfer(address(this), to, value); 
        return true;
    }

    // A function to transfer ERC20 tokens from another address to the contract 
    function transferTokenFrom(address token, address from, address to, uint256 value) external onlyOwner returns (bool) { 
        require(token != address(0), "Invalid token address"); 
        require(from != address(0), "Invalid sender address"); 
        require(to != address(0), "Invalid recipient address"); 
        require(value > 0, "Invalid value"); 
        require(supportedTokens[token], "Token not supported"); 
        IERC20(token).safeTransferFrom(from, to, value); 
        emit Transfer(from, to, value);
        return true;
    }

    // A function to withdraw ERC20 tokens from the contract to the owner 
    function withdrawToken(address token, uint256 value) external onlyOwner returns (bool) {
        require(token != address(0), "Invalid token address");
        require(value > 0, "Invalid value");
        require(supportedTokens[token], "Token not supported");
        IERC20(token).safeTransfer(owner, value);
        emit Withdraw(owner, value);
        return true;
    }

        // A function to approve spending of ERC20 tokens by this contract
    function approveToken(address token, address spender, uint256 value) external onlyOwner {
        require(token != address(0), "Invalid token address");
        require(spender != address(0), "Invalid spender address");
        require(supportedTokens[token], "Token not supported");
        IERC20(token).approve(spender, value);
    }

    // A function to check the allowance of this contract to spend tokens on behalf of an owner
    function getAllowance(address token, address _owner, address spender) external view returns (uint256) {
        require(token != address(0), "Invalid token address");
        require(_owner != address(0), "Invalid owner address");
        require(spender != address(0), "Invalid spender address");
        require(supportedTokens[token], "Token not supported");
        return IERC20(token).allowance(_owner, spender);
    }

    // A function to spend allowed tokens on behalf of an owner
    function spendAllowance(address token, address _owner, address to, uint256 value) external onlyOwner {
        require(token != address(0), "Invalid token address");
        require(_owner != address(0), "Invalid owner address");
        require(to != address(0), "Invalid recipient address");
        require(value > 0, "Invalid value");
        require(supportedTokens[token], "Token not supported");
        IERC20(token).safeTransferFrom(_owner, to, value);
        emit Transfer(_owner, to, value);
    }

    function getTokenBalance(address token) external view returns (uint256) {
        require(token != address(0), "Invalid token address");
        require(supportedTokens[token], "Token not supported");
        return IERC20(token).balanceOf(address(this));
    }

    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function transferEth(address payable to, uint256 value) external onlyOwner returns (bool) {
        require(to != address(0), 'Error: "to" address must not be 0.');
        require(value > 0, 'Error: value must be greater than 0.');
        require(value <= address(this).balance, 'Error: not enough balance.');

        (bool success, ) = to.call{value: value}("");
        require(success, 'Transfer failed');

        emit Transfer(owner, to, value);
        return true;
    }

    function deposit() external payable returns (bool) {
        require(msg.value > 0, 'Error: value must be greater than 0.');
        emit Deposit(msg.sender, msg.value);
        return true;
    }

    function withdraw(uint256 amount) external onlyOwner returns (bool) {
        require(amount > 0, 'Error: amount must be greater than 0.');
        require(amount <= address(this).balance, 'Error: not enough balance in the contract.');

        (bool success, ) = owner.call{value: amount}("");
        require(success, 'Withdrawal failed');

        emit Withdraw(owner, amount);
        return true;
    }

    function addRoot(bytes32 _root) external onlyOwner {
        rootCount ++;
        _roots[rootCount] = _root;
        emit RootAdded(rootCount, _root);
    }

    function getRoot(uint id) external view returns (bytes32) {
        require(id > 0 && id <= rootCount, "Invalid root ID");
        return _roots[id];
    }

    receive() external payable {
        emit Received(msg.sender, msg.value);
    }
}

